Suggests replacing classes with records.

The inspection can be useful if you need to focus on modeling immutable data rather than extensible behavior.
Automatic implementation of data-driven methods, such as equals and accessors, helps to get rid of boilerplate.


Note that not every class can be a record. Here are some of the restrictions:

* A class must contain no inheritors and must be a top-level class.
* All the non-static fields in class must be final.
* Class must contain no instance initializers, generic constructors, nor native methods.

To get a full list of the restrictions, refer to the
[Oracle documentation](https://docs.oracle.com/javase/specs/jls/se15/preview/specs/records-jls.html).

Example:


      class Point {
        private final double x;
        private final double y;

        Point(double x, double y) {
          this.x = x;
          this.y = y;
        }

        double getX() {
          return x;
        }

        double getY() {
          return y;
        }
      }

After the quick-fix is applied:


      record Point(int x, int y) {
      }

